window.bookSummaryJSON = "<p><b>A new ship. A young crew. A dream job gone horribly wrong.</b></p> <p>When circumstances drive Zoya and Natalya to accept an offer from the most powerful organization in the Western Annex, it looks like their ship - literally - comes in. The job fails to live up to its promise and the pair soon find themselves fighting for their lives against a booby trapped ship and its unseen master.</p> <p>Will they unmask their enemies and survive their suicide run?</p> <p>Written in Nathan Lowell's popular Trader's Tales and Seeker's Tales universe.</p>"; 
